### Example Use Case

Suppose we have the following array of strings:

```javascript
const strings = ["Apple", "banana", "Cherry", "date", "Elderberry"];
```

We want to sort this array in a case-insensitive manner, so the expected output would be:

```javascript
["Apple", "banana", "Cherry", "date", "Elderberry"]
```

### Solution

To achieve case-insensitive sorting in JavaScript, you can use the `localeCompare()` method or provide a custom comparison function to the `sort()` method. Here are a few approaches:

#### Approach 1: Using `localeCompare()`

```javascript
const strings = ["Apple", "banana", "Cherry", "date", "Elderberry"];

strings.sort((a, b) => a.localeCompare(b));

console.log(strings);
// Output: ["Apple", "banana", "Cherry", "date", "Elderberry"]
```

