You can use the `prompt()` function in TypeScript to get user input. However,`prompt()` is not available in TypeScript by default. You need to use the `readline` module in Node.js to get user input.

Here is an example of how you can get user input in TypeScript:

```typescript
import * as readline from 'readline';

const rl = readline.createInterface({
  input: process.stdin,
  output: process.stdout
});

rl.question('Please enter your name: ', (answer) => {
  console.log(`Hello, ${answer}!`);
  rl.close();
});
```

In this example, `readline.createInterface()` is used to create a readline interface. The `rl.question()` function is then used to prompt the user for input. The user's response is passed to the callback function as the `answer` parameter.

